import React from 'react';
import './Qna.css';
import QnaThumbNail from './QnaThumbNail';
import QnaFilter from './QnaFilter';
import QnaListItem from './QnaListItem';
import QnaTitleList from './QnaTitleList';
import QnaPageNation from './QnaPageNation';
import Modal from 'react-modal';
import { ModalProvider } from './QnaModal/ModalContext';
import QnaWriteBt from './QnaWriteBt';

Modal.setAppElement('#root');

function Qna() {
    return (
        <ModalProvider>
            <div className="Qna">
                <QnaThumbNail />
                <QnaFilter />
                <QnaTitleList />
                <QnaListItem />
                <QnaWriteBtn />
                <QnaPageNation />
            </div>
        </ModalProvider>
    );
}

export default Qna;
